
<script setup>
import * as echarts from 'echarts';
import 'echarts-wordcloud';
import {onMounted, onUnmounted, ref} from "vue";
import axios from "axios";
const image = 'data:image/png;base64,'
const maskImage = new Image()
maskImage.src = image
let randomData = ref([])
let fixData = ref([])
let displayData = ref([])
let timer = ref()
let chart = ref()
onMounted(() => {
  getData()
})
onUnmounted(() => {
  clearInterval(timer.value)
})
function getData() {
  axios.get('https://sapi.yangshipin.cn/api/x/cctv/wordcloud.json').then(res => {
    randomData.value = randomArr(res.data.sjCai, 30)
    randomData.value.forEach(val => {
      val.value = Math.floor(Math.random() * 10) + 4
    })
    fixData.value = randomArr(res.data.gdCai, res.data.gdSubStep)
    displayData.value = fixData.value.concat(randomData.value).concat(randomData.value).concat(randomData.value).concat(randomData.value).concat(randomData.value)
    // console.log(displayData.value);
    setTimeout(() => {
      initEchart()
      // TODO 定时器
      // timer.value = setInterval(() => getData(), 10000)
    })
  })
}
// 随机从数组中取几个元素
function randomArr(arr, length) {
  let newArr = []
  for(let i = 0; i < length; i++) {
    let index = Math.floor(Math.random()*arr.length)
    let item = arr[index]
    newArr.push(item)
    arr.splice(index,1)
  }
  return newArr
}
function initEchart(){
  if(document.getElementById('myEchart') == null) return
  // console.log(chart.value);
  if(chart.value != null && chart.value != '' && chart.value != undefined) {
    chart.value.dispose(document.getElementById('myEchart'))
  }
  chart.value = echarts.init(document.getElementById('myEchart'))
  const option  = {
    series: [{
      type: 'wordCloud',
      // shape: 'circle',
      keepAspect: false,
  /**
   * 词云轮廓图，支持为 HTMLImageElement, HTMLCanvasElement，不支持路径字符串, 不包含白色区域; 可选选项
   * shape选项将随着云的形状增长而继续应用
   * 有形状限制的时候，最好用背景图来实现，而且这个背景图一定要放base64的，不然词云画不出来
   */
      maskImage: maskImage,
      left: 'center',
      top: 'center',
      width: '100%',
      height: '100%',
      right: null,
      bottom: null,
      sizeRange: [12, 60],
      rotationRange: [0, 0],
      rotationStep: 45,
      gridSize: 8,
      drawOutOfBound: false, // 设置为true可以使单词部分在画布之外绘制, 允许绘制大于画布大小的单词
      layoutAnimation: true,
      textStyle: {
        // fontFamily: 'system-ui',
        // fontFamily: 'serif',
        // fontFamily: 'cursive',
        fontFamily: 'Georgia',
        fontWeight: 'bold',
        color: function () {
         /* return 'rgb(' + [
            Math.round(Math.random() * 255),
            Math.round(Math.random() * 255),
            Math.round(Math.random() * 255)
          ].join(',') + ')';*/
          return 'rgb(100,0,0)'
        }
      },
      emphasis: {
        // focus: 'self',
        textStyle: {
          textShadowBlur: 3,
          textShadowColor: '#333'
        }
      },
      //data属性中的value值却大，权重就越大，展示字体就却大
      data: displayData.value
    }]

  }
  option && chart.value.setOption(option)

/*  //随着屏幕大小调节图表
  window.addEventListener("resize", () => {
    chart.value.resize();
  });*/
}

</script>

<template>
  <div class="content">
<!--    <img :src="image" alt="" style="width: 100px">-->
    <div class="green" id="myEchart">
    </div>
  </div>
</template>

<style scoped>
.content{
  width: 100vh;
  height: 100vh;
  #myEchart{
    width: 100%;
    height: 100%;
  }
}
</style>
